"use client"

import React from 'react';

const SongSwipe = ({ imagePath, title, artist }) => {
  return (
    <div style={{ textAlign: 'center' }}>
      <img src={imagePath} alt="Album Cover" style={{ width: '200px', height: '200px', borderRadius: '50%' }} />
      <h3>{title}</h3>
      <h6>{artist}</h6>
    </div>
  );
};

export default SongSwipe;
